pub enum AddressLookupError {
    LookupTableAccountNotFound,
    InvalidAccountOwner,
    InvalidAccountData,
    InvalidLookupIndex,
}

pub enum ProgramInstruction {
    CreateLookupTable {
            recent_slot: Slot,
            bump_seed: u8,
        },
    FreezeLookupTable,
    ExtendLookupTable {
            new_addresses: Vec<Pubkey>,
        },
    DeactivateLookupTable,
    CloseLookupTable,
}

pub enum LookupTableStatus {
    Activated,
    Deactivating {
            remaining_blocks: usize,
        },
    Deactivated,
}
